import './sectiontable.css'

const data = [
{ name: "Anomaaaaaaaaaaaaaaaaaaaaaaaaaa", age: 19, gender: "Male" },
{ name: "Megha", age: 19, gender: "Female" },
{ name: "Subham", age: 25, gender: "Male"},
]

export default function SectionTable() {
return (
	<table>
		<tr>
		<th></th>
		<th>Nama Mitra</th>
		<th>Action</th>
		</tr>
		{data.map((val, key) => {
		return (
			<tr key={key}>
			<td className='table-img'>{val.name}</td>
			<td>{val.age}</td>
			<td className='table-btn'>
                <button>edit</button>
                <button>delete</button>
            </td>
			</tr>
		)
		})}
	</table>
);
}
